import './App.css';

import React,{Component} from 'react';
import data from './user/users';


class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };


  render(){
    return (
      <h1>{this.myUserList.map(user=>user.first_name)}</h1>
    )
  };

}


export default Table;
